+TextReplacements=(Category=Game, Namespace="", bIsMinimalPatch=True, Key="D9E8C57543A71B6F20DE8D8C76941E48", NativeString="Includes car, car variants, and customizable decals! Items in this bundle are restricted to the Behemoth car body. This Car will fill the SUV slot in relevant Fortnite experiences.", LocalizedStrings=(("ar","تتضمن سيارة وبدائل للسيارة وملصقات قابلة للتخصيص! بدائل السيارة والملصقات المخصصة مقتصرة على هيكل سيارة Behemoth. ستملأ هذه السيارة خانة سيارة الدفع الرباعي في تجارب Fortnite ذات الصلة."),("en","Includes car, car variants, and customizable decals! Car Variants and Customizable decals limited to Behemoth body. This Car will fill the SUV slot in relevant Fortnite experiences."),("de","Enthält ein Auto, Autovarianten und anpassbare Aufkleber! Die Autovarianten und anpassbaren Aufkleber in diesem Paket sind auf die Karosserie „Behemoth“ beschränkt. Dieses Auto belegt in relevanten Fortnite-Erlebnissen den SUV-Slot."),("es","Incluye coche, variantes de coche y calcomanías personalizables. Las variantes de coche y las calcomanías personalizables solo están disponibles para la carrocería del Behemoth. Este vehículo ocupará el espacio del SUV en las experiencias de Fortnite pertinentes."),("es-419","¡Incluye un auto, variantes de auto y calcomanías personalizables! Las variantes de auto y calcomanías personalizables solo están disponibles para la carrocería de Behemoth. Este auto llenará el espacio de TrailSmasher en las experiencias de Fortnite pertinentes."),("fr","Comprend un véhicule et des stickers personnalisables ! Véhicule et stickers réservés au châssis Behemoth. Ce véhicule sera placé dans l'emplacement SUV des expériences de Fortnite concernées."),("it","Include l'auto, le varianti e gli adesivi personalizzabili! Le varianti auto e gli adesivi personalizzati sono limitati alla carrozzeria Behemoth. Questa auto occuperà lo slot SUV nelle esperienze di Fortnite del caso."),("ja","マシン、マシンのバリエーション、カスタマイズ可能なデカールを収録！ マシンのバリエーションとカスタマイズ可能なデカールは、ボディ「Behemoth」に限定されています。このマシンは、対応しているフォートナイトの体験においてSUVとして使用できます。"),("ko","차량, 차량 추가 스타일, 커스터마이징 가능한 데칼 포함! 차량 추가 스타일과 커스터마이징 가능한 데칼은 Behemoth 차체에만 사용할 수 있습니다. 이 차량은 관련 포트나이트 경험에서 SUV 슬롯에 할당됩니다."),("pl","Zawiera samochód, warianty samochodu i konfigurowalne wzory! Warianty samochodu i konfigurowalne wzory można wykorzystać tylko z karoserią Behemoth. Ten samochód znajdzie się w polu SUV-a we wszystkich odpowiednich przygodach Fortnite."),("pt-BR","Inclui carro, variantes do carro e Adesivos personalizados! As variantes do carro e os Adesivos personalizados estão limitados ao Chassi do Behemoth. Este Carro preencherá o espaço de caminhonete nas experiências Fortnite relevantes."),("ru","Включает кузов, варианты внешнего вида и настраиваемые декали! Варианты внешнего вида и настраиваемые декали совместимы только с кузовом Behemoth. Эта машина будет занимать ячейку внедорожника в соответствующих режимах Fortnite."),("tr","Araba, araba çeşitleri ve özelleştirebilir çıkartmalar içerir! Araba çeşitleri ve özelleştirilebilir çıkartmalar, yalnızca Behemoth'un oto gövdesi ile sınırlıdır. Bu araba uygun Fortnite deneyimlerinde SUV yuvasını doldurur.")))
